Wren is a small, fast, class-based concurrent scripting language Think Smalltalk in a Lua-sized package with a dash of Erlang and wrapped up in a familiar, modern syntax. System.print("Hello, world!") class Wren { flyTo(city) { System.print("Flying to %(city)") }
} var adjectives = Fiber.new { ["small", "clean", "fast"].each {|word| Fiber.yield(word) }
} while (!adjectives.isDone) System.print(adjectives.call())
